import React, { useState, useEffect } from 'react';
import { motion, useAnimation } from 'framer-motion';
import './hero.scss'; // Import the CSS file

export default function HomePage() {
  const [searchQuery, setSearchQuery] = useState('');
  const controls = useAnimation();

  useEffect(() => {
    controls.start({
      y: [0, -10, 0],
      transition: { repeat: Infinity, duration: 2 }
    });
  }, [controls]);

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Search query:', searchQuery);
  };

  return (
    <div className="homepage-container">
      <main>
        {/* Hero Section */}
        <section className="hero-section">
          <motion.div
            initial={{ opacity: 0.1, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="text-center"
          >
            <h2 className="hero-title">Unlock Your Potential with Expert Mentorship</h2>
            <p className="hero-subtitle">Connect with industry leaders, accelerate your career growth...</p>
            <div className="flex">
              <button className="cta-button">Get Started</button>
              <form onSubmit={handleSearch} className="search-form">
                <input
                  type="text"
                  placeholder="Search for mentors or topics..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="search-input"
                />
                <button type="submit" className="search-button">Search</button>
              </form>
            </div>
          </motion.div>
        </section>

        {/* Features Section */}
        <section className="features-section">
          <div className="container">
            <h3 className="section-title">Why Choose Us?</h3>
            <div className="grid">
              <div className="feature-card">
                <div className="feature-icon">💡</div>
                <h4 className="feature-title">Expert Mentorship</h4>
                <p className="feature-description">Learn from the best in the industry and get personalized guidance.</p>
              </div>
              <div className="feature-card">
                <div className="feature-icon">🕒</div>
                <h4 className="feature-title">Flexible Scheduling</h4>
                <p className="feature-description">Book sessions at your convenience and manage your time effectively.</p>
              </div>
              <div className="feature-card">
                <div className="feature-icon">🌍</div>
                <h4 className="feature-title">Global Network</h4>
                <p className="feature-description">Connect with mentors from around the world and expand your network.</p>
              </div>
            </div>
          </div>
        </section>

        {/* Testimonials Section */}
        <section className="testimonials-section">
          <div className="container">
            <h3 className="section-title">What Our Users Say</h3>
            <div className="testimonial-card">
              <p className="testimonial-text">"This platform changed my career. The mentors were incredibly helpful and insightful."</p>
              <p className="testimonial-author">- John Doe, Software Engineer</p>
            </div>
            <div className="testimonial-card">
              <p className="testimonial-text">"I was able to land my dream job thanks to the guidance from my mentor. Highly recommend!"</p>
              <p className="testimonial-author">- Michael Smith, Data Scientist</p>
            </div>
          </div>
        </section>

        {/* Call-to-Action Section */}
        <section className="cta-section">
          <h3 className="cta-title">Ready to Accelerate Your Growth?</h3>
          <button className="cta-button">Join Now</button>
        </section>
      </main>
    </div>
  );
}
